import axios from "axios";
import { useEffect, useState } from "react";

const API_URL = "http://localhost:5279/api/todo"; // ✅ Make sure this matches your .NET API

function App() {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    axios.get(API_URL)
      .then(response => {
        setTodos(response.data);
      })
      .catch(error => {
        console.error("Error fetching data:", error);
      });
  }, []);

  return (
    <div>
      <h1>Todo List</h1>
      <ul>
        {todos.map(todo => (
          <li key={todo.id}>{todo.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
